import React from 'react';
import Card from './Card';

export default function Discover({ movieslist }) {

    return (
        <div className='dis-cont'>
        <h2>Movies</h2>
            {
                movieslist.map((movie, index) => (
                    <Card movie={movie} key={movie.id}/>
                ))
            }
        </div>
    )
}
